import React, { useState } from "react";
import "./App.scss";
import TodoList from "./components/TodoList";

function App() {
  const [todoList, setTodoList] = useState([
    {
      id: 1,
      title: "I love you",
    },
    {
      id: 2,
      title: "I love you 3000",
    },
    {
      id: 3,
      title: "We love you",
    },
  ]);
  return (
    <div className="app">
      <h1>React Hooks- TodoList</h1>
      <TodoList todos={todoList} />
    </div>
  );
}

export default App;
